OPEN & WIN: Annemieke Roobeek

Schijnt een mix van commercieel/residentieel te zijn. Parkopedia laat zien dat het €3/u kost. Kan bijna niks vinden over deze garage? 

Bewoners van Detroit en Boston hebben toegang tot de parkeergarage Nieuw Amerika door gebruik te maken van een transponder. Het is schijnbaar heel moeilijk voor bewoners om deze garage in te komen. Lees hieronder de instructies: 

Inrijden parkeergarage Nieuw-Amerika
Omdat het soms nog wel eens gebeurt dat het bewoners niet lukt met hun transponder  in te rijden in de parkeergarage  Nieuw- Amerika hierbij voor de duidelijkheid nog een keer de inrij- instructie:

Plaats uw voertuig naast de kaartterminal, de tekst op de display verandert van datum en tijd naar de gebruikersinstructie;
Houd de transponder met de zuignap richting de ontvanger (blauwe kastje) linksboven aan de pilaar en druk op de knop;
Mocht de speedgate niet in een keer open gaan moet u even wachten tot de ontvanger is gestopt met piepen en drukt u daarna nogmaals op de knop;
Bij de rolluiken tussen -1 en -2 zijn geen sensoren voor voertuigen geplaatst, de ontvanger (het blauwe kastje) reageert op uw transponder  zo lang u niet te ver af staat.
